import 'dart:convert';
import 'dart:typed_data';
import 'package:flutter/material.dart';

class StringToImagePost extends StatelessWidget {
  final String base64String;

  StringToImagePost({required this.base64String});

  @override
  Widget build(BuildContext context) {
    if (base64String == '') {
      Uint8List bytes = base64Decode('');
      return Image.memory(
        bytes,
        fit: BoxFit.cover,
      );
    } else {
      Uint8List bytes = base64Decode(base64String);
      return Image.memory(
        bytes,
        fit: BoxFit.cover,
      );
    }
  }
}